import React, { Component } from 'react';
import './mainVoteContent.css';
import { Alert } from 'reactstrap';
import { Button } from 'reactstrap';

class mainVoteContent extends Component {
  render(){
    return (
      <header>
        <div class="JM_VOTE_CONTENT">
          <div class="content_1">
            <div class="cont_part1">
              <div class="cont_img" id = "cont1_img"></div>
            </div>
            <div class="cont_part2">
              <div class="cont_join_count"></div>
              <div class="cont_title">또가고 싶은 숭실대 맛집은?</div>
              <div class="cont_update_date">
                <div>2021/05/05</div>
              </div>
              <div class="cont_update_cont">
                <div>뭐시껭이 추가완료</div>
              </div>
            </div>
            <div class="cont_part3">
              <div class="cont_writer">
                <div>박철순2</div>
              </div>
            </div>
          </div>
        </div>
      </header>
    );
  }
}

export default mainVoteContent;
